function About(props) {
  return (
    <div>
      <p>
        Born and raised in Rancho San Diego, I spent most of my childhood either
        playing some sort of video game or skateboarding with my friends. My
        first discovery of any type of wed developement was fixing up my
        Myspace. Although it's the most basic of CSS, I always loved doing it.
      </p>
    </div>
  );
}

export default About;
